import { useLocation } from "react-router-dom"
import React, { useEffect, useState } from "react"

function ShopingCart() {
    const location = useLocation();
    const { from } = location.state


    return (<div className="shopingCartContainer">
        <h1>Shoping cart</h1>

       {from.map(item => {
           return <div><img className="cartImgItem" src={item.img} alt="imgItem"></img> <div></div><p>Item : {item.name} </p><p>Quantity : {item.quantity}</p></div>
       })}
        </div>
        )
}



export default ShopingCart
